//SPDX-License-Identifier:MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

contract MyNFT is ERC721URIStorage, Pausable {
    using Counters for Counters.Counter;
    Counters.Counter private tokenId;

    address private manager;
   
    struct PropertyNFT{
        uint256 nftID;
        string nftURI;
        address nftCreater;
        address nftOwner;
        uint256 nftPrice;
        bool nftStatus;
    }

    PropertyNFT [] properties;

    constructor() ERC721("Real Estate", "RLST") {
        manager=msg.sender;
    }

    modifier OnlyManager(){
        require(msg.sender==manager,"Only the manager can pause the NFT Market!");
        _;
    }

    function sellNFT(string memory tokenURI, uint256 price) external whenNotPaused{
        require(msg.sender!=manager,"Manager cannot sell!");
        tokenId.increment();
        uint256 newTokenId = tokenId.current();
        _safeMint(msg.sender, newTokenId);
        _setTokenURI(newTokenId, tokenURI);
        properties.push(PropertyNFT(newTokenId,tokenURI,msg.sender,msg.sender,price,false));
    }

    function buyNFT(uint256 TokenId) external payable whenNotPaused {
        require(msg.sender!=manager,"Manager cannot buy!");
        require(_exists(TokenId), "Token does not exist!");
        require(msg.sender!=properties[TokenId-1].nftOwner,"You are the owner of this NFT!");
        require(properties[TokenId-1].nftStatus==false,"This NFT has been sold already!");
        require(msg.value >= properties[TokenId-1].nftPrice, "Insufficient funds!");
        payable(msg.sender).transfer(msg.value-properties[TokenId-1].nftPrice);
        address owner = ownerOf(TokenId);
        payable(owner).transfer(properties[TokenId-1].nftPrice);
        _transfer(owner, msg.sender, TokenId);
        PropertyNFT storage object = properties[TokenId-1];
        object.nftOwner=msg.sender;
        object.nftStatus=true;
        reset();
    }

    function getNFTS() external view returns(PropertyNFT[]memory) {
        return properties;
    }

    function reset() private {
        uint256 check;
        for(uint256 i=0;i<properties.length;i++){
            if(properties[i].nftStatus==true){
                check++;
            }
        }
        if(check==properties.length){
            delete properties;
        }
    }
    function pause() external OnlyManager {
        _pause();
    }
    
    function unpause() external OnlyManager {
        _unpause();
    }
}

